    "Error starting a task to rescore entrance exam for student '{student_id}'. Make sure that entrance exam has problems in it and student identifier is correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05e2\u05ea \u05de\u05ea\u05df \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05dc\u05de\u05d1\u05d7\u05df \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05dc\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8  '{student_id}'. \u05d5\u05d3\u05d0 \u05e9\u05d9\u05e9 \u05d1\u05e2\u05d9\u05d5\u05ea \u05d1\u05de\u05d1\u05d7\u05df \u05d4\u05db\u05e0\u05d9\u05e1\u05d4 \u05d5\u05db\u05d9 \u05de\u05d6\u05d4\u05d4 \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 \u05e0\u05db\u05d5\u05df.", 
    "Error starting a task to rescore problem '<%- problem_id %>' for student '<%- student_id %>'. Make sure that the the problem and student identifiers are complete and correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05d6\u05de\u05df \u05d4\u05e4\u05e2\u05dc\u05ea \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05d7\u05d9\u05e9\u05d5\u05d1 \u05e6\u05d9\u05d5\u05e0\u05d9\u05dd \u05de\u05d7\u05d3\u05e9 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4  '<%- problem_id %>' \u05e9\u05dc \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '<%- student_id %>'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05d5\u05d4\u05ea\u05dc\u05de\u05d9\u05d3 \u05d4\u05dd \u05de\u05dc\u05d0\u05d9\u05dd \u05d5\u05e0\u05db\u05d5\u05e0\u05d9\u05dd.", 
    "Error starting a task to rescore problem '<%- problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05d4\u05ea\u05d7\u05dc\u05ea \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05ea\u05ea \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05dc\u05d1\u05e2\u05d9\u05d4  '<%- problem_id %>'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05de\u05d5\u05e9\u05dc\u05dd \u05d5\u05e0\u05db\u05d5\u05df. ", 
    "Error starting a task to rescore problem '<%= problem_id %>' for student '<%= student_id %>'. Make sure that the the problem and student identifiers are complete and correct.": "\u05e9\u05d2\u05d9\u05d4 \u05d1\u05d6\u05de\u05df \u05d4\u05e4\u05e2\u05dc\u05ea \u05dc\u05d7\u05d9\u05e9\u05d5\u05d1 \u05e6\u05d9\u05d5\u05e0\u05d9\u05dd \u05de\u05d7\u05d3\u05e9 \u05e2\u05d1\u05d5\u05e8 \u05d1\u05e2\u05d9\u05d4  '<%= problem_id %>' \u05e9\u05dc \u05e1\u05d8\u05d5\u05d3\u05e0\u05d8 '<%= student_id %>'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05d5\u05d4\u05ea\u05dc\u05de\u05d9\u05d3 \u05d4\u05dd \u05de\u05dc\u05d0\u05d9\u05dd \u05d5\u05e0\u05db\u05d5\u05e0\u05d9\u05dd.", 
    "Error starting a task to rescore problem '<%= problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05ea\u05d7\u05d9\u05dc\u05ea \u05de\u05e9\u05d9\u05de\u05ea \u05de\u05ea\u05df \u05e6\u05d9\u05d5\u05df \u05de\u05d7\u05d3\u05e9 \u05dc\u05d1\u05e2\u05d9\u05d4  '<%= problem_id %>'. \u05d5\u05d3\u05d0 \u05e9\u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05e9\u05dc\u05dd \u05d5\u05e0\u05db\u05d5\u05df. ", 
    "Error starting a task to reset attempts for all students on problem '<%- problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05d4\u05ea\u05d7\u05dc\u05ea \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05d0\u05d9\u05e4\u05d5\u05e1 \u05e0\u05d9\u05e1\u05d9\u05d5\u05e0\u05d5\u05ea \u05dc\u05db\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05d1\u05d1\u05e2\u05d9\u05d4 '<%- problem_id %>'. \u05d5\u05d3\u05d0 \u05db\u05d9 \u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05de\u05d5\u05e9\u05dc\u05dd \u05d5\u05e0\u05db\u05d5\u05df.", 
    "Error starting a task to reset attempts for all students on problem '<%= problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u05e9\u05d2\u05d9\u05d0\u05d4 \u05d1\u05ea\u05d7\u05d9\u05dc\u05ea \u05de\u05e9\u05d9\u05de\u05d4 \u05dc\u05d0\u05d9\u05e4\u05d5\u05e1 \u05e0\u05d9\u05e1\u05d9\u05d5\u05e0\u05d5\u05ea \u05dc\u05db\u05dc \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd \u05d1\u05d1\u05e2\u05d9\u05d4 '<%= problem_id %>'. \u05d5\u05d3\u05d0 \u05db\u05d9 \u05de\u05d6\u05d4\u05d4 \u05d4\u05d1\u05e2\u05d9\u05d4 \u05de\u05d5\u05e9\u05dc\u05dd \u05d5\u05e0\u05db\u05d5\u05df. ", 
