    "If the unit was previously published and released to learners, any changes you made to the unit when it was hidden will now be visible to learners.": "\u05d0\u05dd \u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05e4\u05d5\u05e8\u05e1\u05de\u05d4 \u05d1\u05e2\u05d1\u05e8 \u05d5\u05e9\u05d5\u05d7\u05e8\u05e8\u05d4 \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd, \u05db\u05dc \u05d4\u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd, \u05e9\u05d1\u05d9\u05e6\u05e2\u05ea \u05d1\u05d6\u05de\u05df \u05e9\u05d4\u05d9\u05d9\u05ea\u05d4 \u05de\u05d5\u05e1\u05ea\u05e8\u05ea, \u05d9\u05d4\u05d9\u05d5 \u05d2\u05dc\u05d5\u05d9\u05d9\u05dd \u05db\u05e2\u05ea \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd.", 
    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "\u05d0\u05dd \u05d4\u05d9\u05d7\u05d9\u05d3\u05d4 \u05e4\u05d5\u05e8\u05e1\u05de\u05d4 \u05d5\u05d4\u05d5\u05e4\u05e6\u05d4 \u05d1\u05e2\u05d1\u05e8 \u05dc\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd, \u05db\u05dc \u05e9\u05d9\u05e0\u05d5\u05d9 \u05e9\u05e2\u05e8\u05db\u05ea \u05d1\u05d9\u05d7\u05d9\u05d3\u05d4 \u05db\u05d0\u05e9\u05e8 \u05d4\u05d9\u05ea\u05d4 \u05e0\u05e1\u05ea\u05e8\u05ea \u05ea\u05d4\u05d9\u05d4 \u05d2\u05dc\u05d5\u05d9\u05d4 \u05db\u05e2\u05ea \u05d1\u05e4\u05e0\u05d9 \u05d4\u05e1\u05d8\u05d5\u05d3\u05e0\u05d8\u05d9\u05dd. \u05d4\u05d0\u05dd \u05d1\u05e8\u05e6\u05d5\u05e0\u05da \u05dc\u05d4\u05de\u05e9\u05d9\u05da?", 
    "If you do not yet have an account, use the button below to register.": "\u05d0\u05dd \u05d0\u05d9\u05df \u05dc\u05da \u05d7\u05e9\u05d1\u05d5\u05df \u05e2\u05d3\u05d9\u05d9\u05df  \u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05dc\u05d7\u05e6\u05df \u05dc\u05de\u05d8\u05d4 \u05db\u05d3\u05d9 \u05dc\u05d4\u05d9\u05e8\u05e9\u05dd.", 
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from %(platformName)s to verify your identity.": "\u05d0\u05dd \u05d0\u05d9\u05e0\u05da \u05e8\u05d5\u05e6\u05d4 \u05dc\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da \u05db\u05e2\u05ea, \u05d9\u05e9 \u05d1\u05d0\u05e4\u05e9\u05e8\u05d5\u05ea\u05da \u05e2\u05d3\u05d9\u05d9\u05df \u05dc\u05d1\u05d7\u05d5\u05df \u05de\u05dc\u05d5\u05d7 \u05d4\u05d1\u05e7\u05e8\u05d4 \u05d0\u05ea \u05d4\u05e7\u05d5\u05e8\u05e1 \u05e9\u05dc\u05da. \u05ea\u05e7\u05d1\u05dc \u05ea\u05d6\u05db\u05d5\u05e8\u05d5\u05ea \u05ea\u05e7\u05d5\u05e4\u05ea\u05d9\u05d5\u05ea \u05de%(platformName)s \u05e9\u05d1\u05d4\u05df \u05ea\u05ea\u05d1\u05e7\u05e9 \u05dc\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da.", 
    "If you don't verify your identity now, you can still explore your course from your dashboard. You will receive periodic reminders from {platformName} to verify your identity.": "\u05d0\u05dd \u05d0\u05d9\u05e0\u05da \u05de\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da \u05db\u05e2\u05ea, \u05ea\u05d5\u05db\u05dc \u05e2\u05d3\u05d9\u05d9\u05df \u05dc\u05e2\u05d9\u05d9\u05df \u05d1\u05e7\u05d5\u05e8\u05e1 \u05de\u05dc\u05d5\u05d7 \u05d4\u05d1\u05e7\u05e8\u05d4 \u05e9\u05dc\u05da. \u05d0\u05ea\u05d4 \u05ea\u05e7\u05d1\u05dc \u05ea\u05d6\u05db\u05d5\u05e8\u05d5\u05ea \u05ea\u05e7\u05d5\u05e4\u05ea\u05d9\u05d5\u05ea \u05de{platformName} \u05e2\u05dc \u05de\u05e0\u05ea \u05dc\u05d0\u05de\u05ea \u05d0\u05ea \u05d6\u05d4\u05d5\u05ea\u05da.", 
    "If you leave, you can no longer post in this team's discussions. Your place will be available to another learner.": "\u05d0\u05dd \u05ea\u05e2\u05d6\u05d5\u05d1, \u05dc\u05d0 \u05ea\u05d5\u05db\u05dc \u05dc\u05e4\u05e8\u05e1\u05dd \u05d9\u05d5\u05ea\u05e8 \u05d1\u05d3\u05d9\u05d5\u05e0\u05d9 \u05d4\u05e6\u05d5\u05d5\u05ea. \u05de\u05e7\u05d5\u05de\u05da \u05d9\u05ea\u05e4\u05e0\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05ea\u05dc\u05de\u05d9\u05d3 \u05d0\u05d7\u05e8.", 
    "If you make significant changes, make sure you notify members of the team before making these changes.": "\u05d0\u05dd \u05d0\u05ea\u05d4 \u05de\u05d1\u05e6\u05e2 \u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05de\u05e9\u05de\u05e2\u05d5\u05ea\u05d9\u05d9\u05dd, \u05d5\u05d3\u05d0 \u05e9\u05d0\u05ea\u05d4 \u05de\u05d5\u05d3\u05d9\u05e2 \u05dc\u05d7\u05d1\u05e8\u05d9 \u05d4\u05e6\u05d5\u05d5\u05ea \u05dc\u05e4\u05e0\u05d9 \u05d1\u05d9\u05e6\u05d5\u05e2 \u05e9\u05d9\u05e0\u05d5\u05d9\u05d9\u05dd \u05d0\u05dc\u05d4.", 
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "\u05d0\u05dd \u05ea\u05d4\u05e4\u05d5\u05da \u05d0\u05ea %(xblockType)s \u05dc\u05d2\u05dc\u05d5\u05d9 \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd, \u05d9\u05d5\u05db\u05dc\u05d5 \u05d4\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05dc\u05e8\u05d0\u05d5\u05ea \u05d0\u05ea \u05ea\u05d5\u05db\u05e0\u05d5 \u05dc\u05d0\u05d7\u05e8 \u05e9\u05d7\u05dc\u05e3 \u05ea\u05d0\u05e8\u05d9\u05da \u05d4\u05d4\u05e4\u05e6\u05d4 \u05d5\u05e4\u05e8\u05e1\u05d5\u05dd  \u05d4\u05d9\u05d7\u05d9\u05d3\u05d4. \u05e8\u05e7 \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05d4\u05e0\u05e1\u05ea\u05e8\u05d5\u05ea \u05d1\u05d0\u05d5\u05e4\u05df \u05de\u05e4\u05d5\u05e8\u05e9 \u05de\u05e4\u05e0\u05d9 \u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05d9\u05e9\u05d0\u05e8\u05d5 \u05e0\u05e1\u05ea\u05e8\u05d5\u05ea \u05dc\u05d0\u05d7\u05e8 \u05e9\u05ea\u05d5\u05e8\u05d9\u05d3 \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d6\u05d5 \u05de\u05d4-%(xblockType)s.", 
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "\u05d0\u05dd \u05ea\u05d1\u05d7\u05e8 \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d0\u05d7\u05e8\u05ea \u05e9\u05d0\u05d9\u05e0\u05d4 \"%(hide_label)s\", \u05d9\u05d7\u05d9\u05d3\u05d5\u05ea \u05e9\u05e4\u05d5\u05e8\u05e1\u05de\u05d5 \u05d1\u05ea\u05ea \u05e4\u05e8\u05e7 \u05d6\u05d4 \u05d9\u05d4\u05d9\u05d5 \u05d6\u05de\u05d9\u05e0\u05d5\u05ea \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd \u05d0\u05dc\u05d0 \u05d0\u05dd \u05db\u05df \u05d4\u05d5\u05e1\u05ea\u05e8\u05d5 \u05dc\u05dc\u05d5\u05de\u05d3\u05d9\u05dd.", 
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "\u05d1\u05de\u05d9\u05d3\u05d4 \u05d5\u05d0\u05ea\u05d4 \u05de\u05e9\u05ea\u05de\u05e9 \u05d1\u05e2\u05d5\u05e8\u05da \u05de\u05ea\u05e7\u05d3\u05dd, \u05d1\u05e2\u05d9\u05d4 \u05d6\u05d5 \u05ea\u05d5\u05de\u05e8 \u05dc\u05e4\u05d5\u05e8\u05de\u05d8 XML \u05d5\u05dc\u05d0 \u05ea\u05d5\u05db\u05dc \u05dc\u05d7\u05d6\u05d5\u05e8 \u05dc\u05de\u05de\u05e9\u05e7 \u05e9\u05dc \u05e2\u05d5\u05e8\u05da \u05e4\u05e9\u05d5\u05d8.\n\n\u05d4\u05d0\u05dd \u05dc\u05d4\u05de\u05e9\u05d9\u05da \u05dc\u05e2\u05d5\u05e8\u05da \u05de\u05ea\u05e7\u05d3\u05dd \u05d5\u05dc\u05d4\u05de\u05d9\u05e8 \u05d0\u05ea \u05d4\u05d1\u05e2\u05d9\u05d4 \u05dc-XML?", 
