    "Textbook Name": "\u05e9\u05dd \u05e1\u05e4\u05e8 \u05d4\u05e7\u05d5\u05e8\u05e1", 
    "Textbook information": "\u05de\u05d9\u05d3\u05e2 \u05e2\u05dc \u05e1\u05e4\u05e8 \u05d4\u05e7\u05d5\u05e8\u05e1", 
