    "Type": "\u05e1\u05d5\u05d2", 
    "Type in a URL or use the \"Choose File\" button to upload a file from your machine. (e.g. 'http://example.com/img/clouds.jpg')": "\u05d4\u05e7\u05dc\u05d3 \u05d1\u05db\u05ea\u05d5\u05d1\u05ea \u05d0\u05ea\u05e8 \u05d0\u05d5 \u05d4\u05e9\u05ea\u05de\u05e9 \u05d1\u05dc\u05d7\u05e6\u05df \"\u05d1\u05d7\u05e8 \u05e7\u05d5\u05d1\u05e5\" \u05db\u05d3\u05d9 \u05dc\u05d4\u05e2\u05dc\u05d5\u05ea \u05e7\u05d5\u05d1\u05e5 \u05de\u05d4\u05de\u05d7\u05e9\u05d1 \u05e9\u05dc\u05da. (\u05dc\u05d3\u05d5\u05d2\u05de\u05d4 'http://example.com/img/clouds.jpg')", 
    "URL": "\u05db\u05ea\u05d5\u05d1\u05ea URL", 
    "Unable to retrieve data, please try again later.": "\u05dc\u05d0 \u05e0\u05d9\u05ea\u05df \u05dc\u05d0\u05d7\u05d6\u05e8 \u05e0\u05ea\u05d5\u05e0\u05d9\u05dd, \u05d0\u05e0\u05d0 \u05e0\u05e1\u05d4 \u05e9\u05d5\u05d1 \u05de\u05d0\u05d5\u05d7\u05e8 \u05d9\u05d5\u05ea\u05e8.", 
