    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "\u05e9\u05dc\u05d7\u05e0\u05d5 \u05d4\u05d5\u05d3\u05e2\u05ea \u05d0\u05d9\u05e9\u05d5\u05e8 \u05d0\u05dc {new_email_address}. \u05dc\u05d7\u05e5 \u05e2\u05dc \u05d4\u05e7\u05d9\u05e9\u05d5\u05e8 \u05e9\u05d1\u05d4\u05d5\u05d3\u05e2\u05d4 \u05db\u05d3\u05d9 \u05dc\u05e2\u05d3\u05db\u05df \u05d0\u05ea \u05db\u05ea\u05d5\u05d1\u05ea \u05d4\u05d3\u05d5\u05d0\u05e8 \u05d4\u05d0\u05dc\u05e7\u05d8\u05e8\u05d5\u05e0\u05d9 \u05e9\u05dc\u05da.", 
